import React, { useState } from 'react';
import Garden from "./Garden";

    export default function ActionLink() {
    const [ listeGarden, setlisteGarden ] = useState([<Garden />])
    function handleClick(e) {
        e.preventDefault();
        setlisteGarden(listeGarden + 1)
    }

    return (
        <div className="d-flex flex-column align-items-center">
            <div className="d-flex flex-column align-items-center">
                {listeGarden.map((garden, index) => {
                    return <div key={index}>{garden}</div>
                })}
            </div>
            <button className="btn btn-primary mt-5" onClick={() => setlisteGarden(listeGarden + 1)}>
                Add a garden
            </button>
        </div>
    );
}
